export const PAGE_URL = {
  TOP: "/",
  PAGE2: "/page2",
  GOOD: "/page3",
  TEST: "/test",
};
export const PAGE_NAME = {
  TOP: "top",
  PAGE2: "page2",
  GOOD: "good",
  TEST: "test",
};

export const PAGE_NAME_ARRAY = ["page2", "good", "test"];
export const PAGE_URL_ARRAY = ["/page2", "good", "test"];

export const PAGES = [
  { name: "top", title: "top", url: "/" },
  { name: "page2", title: "page2", url: "/page2" },
  { name: "good", title: "good", url: "/page3" },
  { name: "test", title: "test", url: "/test" },
];
